import React, { useState } from 'react';
import '../styles/Auth.css';

function RegisterPage() {
  const [formData, setFormData] = useState({
    username: '',
    password: '',
    passwordConfirm: '',
    email: '',
    name: ''
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    
    // ÎπÑÎ∞ÄÎ≤àÌò∏ ÌôïÏù∏
    if (formData.password !== formData.passwordConfirm) {
      alert('ÎπÑÎ∞ÄÎ≤àÌò∏Í∞Ä ÏùºÏπòÌïòÏßÄ ÏïäÏäµÎãàÎã§.');
      return;
    }

    console.log('ÌöåÏõêÍ∞ÄÏûÖ:', formData);
    // TODO: API Ìò∏Ï∂ú
  };

  return (
    <div className="auth-container">
      <div className="auth-box">
        <h1 className="auth-title">ÌöåÏõêÍ∞ÄÏûÖ</h1>
        <p className="auth-subtitle">RecipeNoteÏôÄ Ìï®Íªò ÏãúÏûëÌïòÏÑ∏Ïöî üéâ</p>

        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label>ÏïÑÏù¥Îîî *</label>
            <input
              type="text"
              name="username"
              value={formData.username}
              onChange={handleChange}
              placeholder="4-20Ïûê, ÏòÅÎ¨∏+Ïà´Ïûê"
              required
            />
            <p className="form-hint">ÏòÅÎ¨∏ ÏÜåÎ¨∏ÏûêÏôÄ Ïà´ÏûêÎßå ÏÇ¨Ïö© Í∞ÄÎä•Ìï©ÎãàÎã§</p>
          </div>

          <div className="form-group">
            <label>ÎπÑÎ∞ÄÎ≤àÌò∏ *</label>
            <input
              type="password"
              name="password"
              value={formData.password}
              onChange={handleChange}
              placeholder="8Ïûê Ïù¥ÏÉÅ, ÏòÅÎ¨∏+Ïà´Ïûê+ÌäπÏàòÎ¨∏Ïûê"
              required
            />
            <p className="form-hint">ÏïàÏ†ÑÌïú ÎπÑÎ∞ÄÎ≤àÌò∏Î•º ÏÇ¨Ïö©ÌïòÏÑ∏Ïöî</p>
          </div>

          <div className="form-group">
            <label>ÎπÑÎ∞ÄÎ≤àÌò∏ ÌôïÏù∏ *</label>
            <input
              type="password"
              name="passwordConfirm"
              value={formData.passwordConfirm}
              onChange={handleChange}
              placeholder="ÎπÑÎ∞ÄÎ≤àÌò∏Î•º Îã§Ïãú ÏûÖÎ†•ÌïòÏÑ∏Ïöî"
              required
            />
          </div>

          <div className="form-group">
            <label>Ïù¥Î©îÏùº *</label>
            <input
              type="email"
              name="email"
              value={formData.email}
              onChange={handleChange}
              placeholder="example@email.com"
              required
            />
            <p className="form-hint">Ïù¥Î©îÏùº Ïù∏Ï¶ùÏù¥ ÌïÑÏöîÌï©ÎãàÎã§</p>
          </div>

          <div className="form-group">
            <label>Ïù¥Î¶Ñ *</label>
            <input
              type="text"
              name="name"
              value={formData.name}
              onChange={handleChange}
              placeholder="Ïù¥Î¶ÑÏùÑ ÏûÖÎ†•ÌïòÏÑ∏Ïöî"
              required
            />
          </div>

          <button type="submit" className="btn-primary">
            Í∞ÄÏûÖÌïòÍ∏∞
          </button>

          <button
            type="button"
            className="btn-secondary"
            onClick={() => window.location.href = '/login'}
          >
            Ïù¥ÎØ∏ Í≥ÑÏ†ïÏù¥ ÏûàÏúºÏã†Í∞ÄÏöî? Î°úÍ∑∏Ïù∏
          </button>
        </form>
      </div>
    </div>
  );
}

export default RegisterPage;
